            fullName: "shoka koko",
            imgUrl: "https://upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Circle-icons-profile.svg/1200px-Circle-icons-profile.svg.png",
            rating: 5,
            isAdmin: false,
            languages: ["he", "en"],
            trails: [
                {
                    _id: "fg3d",
                    name: "Sahara desert",
                    imgUrls: ["", ""]
                }
            ] // id, name, country
