    }

    render() {
        const { user } = this.state
        return (
            <div className="booking-page">
                <section>
                    <img className="booking-page-img" src={user.imgUrl} width="75px" />
                    <p>{user.fullName}</p>
                    <p>Rating:</p>
                    <div>

                    </div>
                </section>


            </div>
        )
    }
}




